        <title>Gem Saviour Conquest</title>
        <style id="initial-style">
            body {
                height: 100vh;
                margin: 0;
                width: 100vw
            }

            #game-shell {
                display: flex;
                height: 100%;
                position: fixed;
                width: 100%
            }

            #game-overlay {
                height: 0;
                position: absolute;
                width: 0
            }

            #background-img {
                background-size: cover;
                bottom: -10%;
                height: 110%;
                left: 0;
                position: absolute;
                right: 0;
                top: 0;
                width: 100%
            }

            #block-page,#scroll-area {
                height: 100%;
                position: absolute;
                width: 100%
            }

            #block-page {
                left: 0;
                margin: auto;
                top: 0
            }
        </style>
        <style id="loader-style">
            #initial-loader {
                background-color: #000;
                height: 100%;
                margin: auto;
                position: fixed;
                width: 100%
            }

            #initial-loader,.svg-loading {
                align-items: center;
                display: flex;
                flex-direction: column;
                justify-content: center
            }

            .circle-loading {
                align-items: center;
                display: flex;
                height: 10px;
                justify-content: space-between;
                width: 40px
            }

            .hide-loading {
                animation-duration: .35s;
                animation-fill-mode: forwards;
                animation-name: fade-out;
                animation-timing-function: ease-in
            }

            .loader-circle {
                animation-direction: alternate;
                animation-duration: .25s;
                animation-iteration-count: infinite;
                animation-name: loader-circle-bounce;
                animation-timing-function: ease-out;
                background-color: #30a2d0;
                border-radius: 50%;
                height: 10px;
                position: relative;
                width: 10px
            }

            .loader-circle:first-of-type {
                animation-delay: 0s
            }

            .loader-circle:nth-of-type(2) {
                animation-delay: -75ms
            }

            .loader-circle:nth-of-type(3) {
                animation-delay: -.15s
            }

            @keyframes loader-circle-bounce {
                0% {
                    bottom: 0
                }

                90%,to {
                    bottom: 15px
                }
            }

            @keyframes fade-out {
                to {
                    opacity: 0
                }
            }

            @keyframes fade-in {
                to {
                    opacity: 1
                }
            }
        </style>
    </head>
